import React from 'react';

const Dashboard = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">Your Trip Dashboard</h1>
      <p className="text-gray-600">Manage your created and joined trips here (to be implemented).</p>
    </div>
  );
};

export default Dashboard;
